import React from "react";

function Header() {
  return (
    <header style={{ background: "#007bff", color: "white", padding: "15px" }}>
      <h1>Smart Dental Service Manager</h1>
      <nav>
        <a href="/" style={{ color: "white", marginRight: "15px" }}>Trang chủ</a>
        <a href="/services" style={{ color: "white", marginRight: "15px" }}>Dịch vụ</a>
        <a href="/contact" style={{ color: "white" }}>Liên hệ</a>
      </nav>
    </header>
  );
}

export default Header;
